import React from "react";
import { Route, Switch } from "react-router-dom";
import HomePage from "../pages/HomePage";
import SiparisPage from "../pages/SiparisPage";
import SeceneklerPage from "../pages/SeceneklerPage";
import UrunDetayiPage from "../pages/UrunDetayiPage";
const PageContent = () => {
  return (
    // Page Componentleri
    <div>
      <Switch>
        <Route path="/" exact>
          <HomePage />
        </Route>
        <Route path="/siparis-ver" exact>
          <SiparisPage />
        </Route>
        <Route path="/secenekler" exact>
          <SeceneklerPage />
        </Route>
        <Route path="/siparis-ver/:menuItem.id" exact>
          <UrunDetayiPage />
        </Route>
      </Switch>
    </div>
  );
};

export default PageContent;
